import React from 'react';
import '.././style/App.css';
import Sample from '.././feed/sample.json'

class Movies extends React.Component {

  render(){
    return(
      <div>
        <div class="titre">
          <p>
            Popular Movies
          </p>
        </div>

        {
          Sample.map((post,index)=>{
            return <div>
                    <p>{post.total} </p>
                  </div>
              }
        )
        }
      </div>
    );
  }
}

export default Movies;
